webpackJsonp([79227080501121],{284:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Reading</h3>\n<ul>\n<li><a href="http://bobcat.library.nyu.edu/primo-explore/fulldisplay?docid=nyu_aleph003069912&#x26;context=L&#x26;vid=NYU&#x26;lang=en_US&#x26;search_scope=all&#x26;adaptor=Local%20Search%20Engine&#x26;isFrbr=true&#x26;tab=all&#x26;query=any,contains,daniel%20levitin&#x26;sortby=date&#x26;facet=frbrgroupid,include,22427351&#x26;mode=basic&#x26;offset=0"><em>This Is Your Brain On Music</em></a>, Chapter 2: Foot tapping</li>\n</ul>\n<h3>Assignment</h3>\n<blockquote>\n<p>Create a digital, audio-visual, sample based instrument. You can record your own samples, or use existing ones. Once it\'s done (or almost done), compose a ~20-30 second piece using your instrument and do a video recording of it.</p>\n</blockquote>\n<p>I used few samples I downloaded from <a href="http://splice.com/">Splice</a> to create a simple drum machine.</p>\n<p><a href="https://editor.p5js.org/adidahiya/sketches/BJwt8Dau7">Here\'s a link to my code</a>.</p>\n<p>Here\'s my short techno-inspired piece:</p>\n<iframe src="https://player.vimeo.com/video/290343127" width="640" height="470" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>',frontmatter:{date:"17 September, 2018",title:"Week 1 sample-based instrument"},fields:{slug:"/blog/itp/code-of-music/sample-based-instrument/"}}},pathContext:{slug:"/blog/itp/code-of-music/sample-based-instrument/"}}}});
